window.bookSummaryJSON = "<p>When Emma moves to Astoria, Oregon, she is given two rules: </p> <p><i>#1 - don’t cross to “their” side of the street.</i><br> <i>#2 - don’t mess with the elites, especially Lexen Darken, top elite and resident bad boy.</i></p> <p>While she finds this both weird and insulting, Emma has no actual intention of breaking these rules - until her guardians go missing. Now all bets are off. Only a single line separates her side of the street from the elites', and she's crossing it. </p> <p>Captured and held by Lexen and his brothers, she learns the rules are in place for a very good reason. There's a secret world hidden in this small town that goes far beyond the one she knows and understands. </p> <p><b>A world not for humans.</b> </p> <p>This is a full-length fantasy/paranormal romance story. It's upper YA, with cursing and some nondetailed sex scenes/references. </p> <p>Listening order of the Secret Keepers series: <br> <i>House of Darken</i><br> <i>House of Imperial</i><br> <i>House of Leights</i><br> <i>House of Royale</i><br> </p>"; 
